import React,{FC} from 'react'
import cl from './WeatherCard.module.css'


const WeatherCard:FC = () => {
  return (
    <div className={cl.card}>
        <h1 className={cl.card__title}>Moscow</h1>        
        <div className={cl.card__inner}>

        </div>
    </div>
  )
}

export default WeatherCard
